('signup.legal.content', 'de', 'messages', '<p>&nbsp;</p>\n<p>Handelsname: <strong>%company%</strong> \n<br/>CIF / NIF: <strong>%company_id%</strong> \n<br/>E-Mail: %company_email%\n<br/>Domain Name: <strong>%base_url%</strong></p>\n<p>&nbsp;</p>\n<p>Der Anbieter, verantwortlich für die Website, bietet dem Anwender dieses Dokument, das die Verpflichtungen aus dem Gesetz 34/2002 von Dienstleistungen der Informationsgesellschaft und des elektronischen Handels zu erfüllen soll ( LSSI-CE) und informieren alle Nutzer der Website, was sind die Bedingungen für die Nutzung der Website.</p>\n<p>Der Anbieter behält sich das Recht zu ändern, zu korrigieren, zu ergänzen oder alle Informationen zu löschen, die auf der Website oder deren Design, ohne vorherige Ankündigung oder zur Information der Nutzer dieser Verpflichtungen Bedeutung erscheinen könnte genug, um mit der Veröffentlichung auf der Website des Anbieters. </p>\n<p>Der Anbieter übernimmt keinerlei Haftung für die Informationen auf ihrer Website veröffentlicht, sofern diese Information von einer Partei außerhalb sie manipuliert oder eingeführt worden ist. </ P>\n<p>Von der Website des Kunden kann auf Inhalte Dritter Websites umgeleitet werden. Da der Anbieter die Inhalte nicht immer von Dritten auf ihren Internetseiten kontrollieren können, übernimmt sie keine Verantwortung für solche Inhalte. Auf jeden Fall, sagte der Kreditgeber, dass sofort gehen alle Inhalte zu entfernen, die nationale oder internationale Gesetze, die guten Sitten oder die öffentliche Ordnung verletzen könnte, ausgehend zu den sofortigen Rückzug der Umleitung auf die Website, die Anmelderin zuständigen Behörden der betreffenden Inhalte. </p>\n<p>Diese Website wurde überprüft und getestet ordnungsgemäß funktioniert. Grundsätzlich kann es den korrekten Betrieb an 365 Tagen im Jahr, 24 Stunden am Tag zu gewährleisten. Allerdings ist der Anbieter nicht die Möglichkeit ausschließen, dass es bestimmte Programmierfehler, oder dass aufgrund von höherer Gewalt, Naturkatastrophen, Streiks oder ähnliche Umstände machen es unmöglich zufällig auf die Website zugreifen. </p>', '2017-02-26 17:38:23', '2017-02-26 17:38:23'),
('signup.legal.content', 'en', 'messages', '<p>&nbsp;</p>\n<p>Tradename: <strong>%company%</strong> \n<br/>CIF / NIF: <strong>%company_id%</strong> \n<br/>E-Mail: %company_email%\n<br/>Domain name: <strong>%base_url%</strong></p>\n<p> The provider, responsible for the website, offers users this document that aims to fulfill the obligations under the Law 34/2002 of Services Information Society and Electronic Commerce ( LSSI-CE) and inform all users of the website as to what are the conditions of use of the website. </ p>\n<p> The provider reserves the right to modify, correct, add or delete any information that could appear on the website or its design, without any forewarning or to inform users such obligations, meaning enough with the publication on the website of the provider. </ p>\n<p> The provider disclaims any liability for the information posted on its website, provided that this information has been manipulated or introduced by a party external to it. </p>\n<p> From the client website may be redirected to third party content websites. Since the provider can not always control the contents posted by third parties on their websites, it assumes no responsibility for such content. In any case, the lender said that immediately proceed to remove any content that could violate national or international law, morality or public order, proceeding to the immediate withdrawal of the redirect to the website, notifying the competent authorities the content in question. </ p>\n<p> This website has been reviewed and tested to work properly. In principle, it can ensure the correct operation 365 days a year, 24 hours a day. However, the provider does not rule out the possibility that there are certain programming errors, or that happen due to force majeure, natural disasters, strikes or similar circumstances make it impossible to access the website. </p>\n<p> &nbsp; </ p>\n<h1 class = "title"> Privacy </h1>\n<p> &nbsp; </ p>\n<p> The provider offers users the Policy & nbsp; data from the controller.\n<br/> File in which are stored.\n<br/> Mandatory or not provided, as well as the consequences of not providing them.\n<br/> Regardless of the purpose for which they were intended, total or partial reproduction, use, exploitation, distribution and marketing, in any case it requires the prior written authorization by the provider. Any use not previously authorized by the provider will be considered a serious breach of the rights of intellectual property of the author. </p>\n<p> &nbsp; </ p>\n<p> The provider <em> does not authorize </em> explicitly to third parties to redirect directly to the specific contents of the website, in any case must redirect to the main website of the provider. </p>\n<p> To make any comments concerning possible breaches of the rights of intellectual property, as well as any of the contents of the website, you can do so via the following email. </p>', '2017-02-26 17:38:36', '2017-02-26 17:38:36'),
('signup.legal.content', 'es', 'messages', '<p>&nbsp;</p>\n<p>Nombre Comercial: <strong>%company%</strong> \n<br/>CIF / NIF: <strong>%company_id%</strong> \n<br/>E-Mail: %company_email%\n<br/>Nombre de dominio: <strong>%base_url%</strong></p>\n<p>&nbsp;</p>\n<p>El prestador, responsable del sitio web, pone a disposición de los usuarios el presente documento con el que pretende dar cumplimiento a las obligaciones dispuestas en la Ley 34/2002, de Servicios de la Sociedad de la Información y del Comercio Electrónico (LSSI-CE), así como informar a todos los usuarios del sitio web respecto a cuáles son las condiciones de uso del sitio web.</p>\n<p>El prestador se reserva el derecho a modificar, corregir, añadir o eliminar cualquier tipo de información que pudiera aparecer en el sitio web o en su diseño, sin que exista obligación de preavisar o poner en conocimiento de los usuarios dichas obligaciones, entendiéndose como suficiente con la publicación en el sitio web del prestador.</p>\n<p>El prestador se exime de cualquier tipo de responsabilidad derivada de la información publicada en su sitio web, siempre que esta información haya sido manipulada o introducida por un tercero ajeno al mismo.</p>\n<p>Desde el sitio web del cliente es posible que se redirija a contenidos de terceros sitios web. Dado que el prestador no puede controlar siempre los contenidos introducidos por los terceros en sus sitios web, éste no asume ningún tipo de responsabilidad respecto a dichos contenidos. En todo caso, el prestador manifiesta que procederá a la retirada inmediata de cualquier contenido que pudiera contravenir la legislación nacional o internacional, la moral o el orden público, procediendo a la retirada inmediata de la redirección a dicho sitio web, poniendo en conocimiento de las autoridades competentes el contenido en cuestión.</p>\n<p>Este sitio web ha sido revisado y probado para que funcione correctamente. En principio, puede garantizarse el correcto funcionamiento los 365 días del año, 24 horas al día. No obstante, el prestador no descarta la posibilidad de que existan ciertos errores de programación, o que acontezcan causas de fuerza mayor, catástrofes naturales, huelgas, o circunstancias semejantes que hagan imposible el acceso a la página web.</p>\n<p>&nbsp;</p>\n<h1 class="title">Protección de datos personales</h1>\n<p>&nbsp;</p>\n<p>El prestador pone a disposición de los usuarios la Política&nbsp;Datos del Responsable del tratamiento.\n<br/>Fichero en el que se almacenan. \n<br/>Obligatoriedad o no de facilitarlos, así como las consecuencias en caso de no facilitarlos.\n<br/>Independientemente de la finalidad para la que fueran destinados, la reproducción total o parcial, uso, explotación, distribución y comercialización, requiere en todo caso de la autorización escrita previa por parte del prestador. Cualquier uso no autorizado previamente por parte del prestador será considerado un incumplimiento grave de los derechos de propiedad intelectual o industrial del autor.</p>\n<p>&nbsp;</p>\n<p>El prestador <em>no autoriza</em> expresamente a que terceros puedan redirigir directamente a los contenidos concretos del sitio web, debiendo en todo caso redirigir al sitio web principal del prestador.</p>\n<p>Para realizar cualquier tipo de observación respecto a posibles incumplimientos de los derechos de propiedad intelectual o industrial, así como sobre cualquiera de los contenidos del sitio web, puede hacerlo a través del siguiente correo electrónico.</p>', '2017-02-26 17:38:11', '2017-02-26 17:38:11'),
